import React from 'react';
import { BsTwitter, BsInstagram } from 'react-icons/bs';
import { FaFacebookF } from 'react-icons/fa';

const SocialMedia = () => (
  <div className="app__social">
    <div>
      <BsTwitter />
    </div>
    <div>
      <FaFacebookF />
      <a href='https://www.facebook.com/profile.php?id=100008158209541'></a>
    </div>
    <div>
      <BsInstagram />
       <a href='https://instagram.com/ogelsby_barner?igshid=MzNlNGNkZWQ4Mg=='></a>
    </div>
  </div>
);

export default SocialMedia;
